import React from 'react'
import FeatureList from './FeatureList'
import './Feature.css'

const allFeature = [
    {
        key: "1",
        label: "Head Movement",
        icon: "fas fa-code-branch fas-fade",
        children: [
            {
                key: "1a",
                label: "Left",
                icon: "fas fa-code-branch fas-fade",
            },
            {
                key: "1b",
                label: "Right",
                icon: "fas fa-code-branch fas-fade",
            },
            {
                key: "1c",
                label: "Up",
                icon: "fas fa-code-branch fas-fade",
            },
            {
                key: "1d",
                label: "Down",
                icon: "fas fa-code-branch fas-fade",
            }
        ]
    },
    {
        key: "2",
        label: "Facial Expression",
        icon: "fas fa-code-branch fas-fade",
        children: [
            {
                key: "2a",
                label: "Happy",
                icon: "fas fa-code-branch fas-fade",
            },
            {
                key: "2b",
                label: "Sad",
                icon: "fas fa-code-branch fas-fade",
            },
            {
                key: "2c",
                label: "Angry",
                icon: "fas fa-code-branch fas-fade",
            },
            {
                key: "2d",
                label: "Surprise",
                icon: "fas fa-code-branch fas-fade",
            },
            {
                key: "2e",
                label: "Disgust",
                icon: "fas fa-code-branch fas-fade",
            }, 
            {
                key: "2f",
                label: "Neutral",
            }
        ]
    },
    {
        key: "3",
        label: "Eye Movement",
        children: [
            {
                key: "3a",
                label: "Left",
            },
            {
                key: "3b",
                label: "Right",
            },
            {
                key: "3c",
                label: "Up",
            },
            {
                key: "3d",
                label: "Down",
            }
        ]
    },
    {
        key: "4",
        label: "Gender Customization",
        children: [
            {
                key: "4a",
                label: "Male",
            },
            {
                key: "4b",
                label: "Female",
            }
        ]
    },
    {
        key: "5",
        label: "Face Aging",
        children: [
            {
                key: "5a",
                label: "Older",
            },
            {
                key: "5b",
                label: "Younger",
            }
        ]
    },
    {
        key: "6",
        label: "Anime-Style",
        children: [
            {
                key: "6a",
                label: "Anime"
            }
        ]
    },
    {
        key: "7",
        label: "Produce Audio",
        children: [
            {
                key: "7a",
                label: "Audio Clip 1"
            },
            {
                key: "7b", 
                label: "Audio Clip 2"
            },
            {
                key: "7c",
                label: "Audio Clip 3"
            }
        ]
    }
]


const Feature = () => {
  return (
    <>
        <div className="row">
            <div className="col text-center">
                <h2>Features</h2>
                <div className="mt-3">
                    <div className="row mt-3 d-flex justify-content-center">
                        <div className="col-lg-8 text-left text-dark">
                            <FeatureList data={allFeature} />  
                        </div>
                    </div>    
                </div>
            </div>
        </div>
    </>
  )
}

export default Feature
